const fs = require('fs');

function Member({name, photo, text}){
    
    return (
        <div className="info-container">
            <img className="info-photo" src={photo} alt={name}/>

            <h3 className="heading"> {name} </h3>

            <p className="info-text">
                { text }
            </p>
        </div>
    );
}

export default Member;
